import { useEffectLogin } from "../../hooks/login.hooks";
import { handleSubmit } from "./Form.component";
export const FormHtml = () => {
  const data = useEffectLogin();
  console.log(data);
  return (
    <div>
      <h1>hello Wolrd</h1>
      <button onClick={handleSubmit}>Click Me</button>
      {data.map((res) => (
        <div key={res.id_user}>{res.username}</div>
      ))}
    </div>
  );
};
